import '../../assets/css/EditStudent.css';


function NewStudent() {
  return (
    <div class="container-fluid">
      <div class="col-md-12">
            <div class="card">
                <div class="card-header"> 
                <h2 class="title-table">Edit Student</h2>
            </div>
                <div class="card-body">
                    <form>
                        <h1>TESTE DE RENDERIZAÇÃO</h1>
                        <h1>EDITAR</h1>
                        <button type="button" class="btn btn-danger pull-left bt-back">Return</button>
                    </form>
                </div>
            </div>
       </div>
    </div>
  );
}

export default NewStudent;
